description:
Transcribe Version 8.21.2 - Get those licks! Windows version

Transcribe is the world's leading software for helping musicians to work out music from recordings. This application has loads of useful functions. It is also used by many people for play-along practice, and also for speech transcription.

Package content:
- Transcribe Ver 8.21.2 Setup, run this to install Transcribe
- Keygen, run this after installation of Transcribe and with Transcribe closed down, to patch Transcribe and to register a key
- Info, this text
- 5 min video tutorial in flv format, use e.g. VLC Media Player for watching
- Flyer, a one page PDF product info file
- Screenshot
- Virustotal scan result for the setup file - xscsetup (detection rate 0 of 43)
- Virustotal scan result for the keygen (detection rate 8 of 43, most probably false positives by lesser known antivirus scanners. Major antivirus scanners (for example Kaspersky and Symantec) report the file as clean)

(You can upload any file to Virustotal to have it rechecked)


